import React, { useState } from 'react';
import styled from "styled-components";

const InputWrapper = styled.div`
  width: 100%;
  margin: 8px 0;
`;

const FormContainer = styled.div`
  padding: 20px;
  color: white;
`;

const StyledSelect = styled.select`
  width: 100%;
  padding: 8px;
  margin-top: 8px;
  box-sizing: border-box;
  border: none;
  outline: none;
  background: #f1f3f4;
  border-bottom: 1px solid #d2d6dc;
  transition: border-bottom-color 0.25s ease-in-out;
  font-family: 'Roboto', sans-serif;

  &:focus {
    border-bottom-color: #3f51b5;
  }
`;

const StyledInput = styled.input`
  width: 100%;
  padding: 8px;
  margin-top: 8px;
  box-sizing: border-box;
  border: none;
  outline: none;
  background: #f1f3f4;
  border-bottom: 1px solid #d2d6dc;
  transition: border-bottom-color 0.25s ease-in-out;
  font-family: 'Roboto', sans-serif;

  &:focus {
    border-bottom-color: #3f51b5;
  }
`;

const StyledButton = styled.button`
  width: 50px;
  height: 50px;
  display: flex;
  justify-content: center;
  align-items: center;
  border: none;
  color: white;
  font-size: 20px;
  border-radius: 50%; // Makes the button round
  cursor: pointer;
`;

const PlusButton = styled(StyledButton)`
  background-color: #66cc99;
`;

const MinusButton = styled(StyledButton)`
  background-color: crimson;
`;

const StyledForm = styled.form`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
`;


const ButtonContainer = styled.div`
  display: flex;
  justify-content: flex-start;
  width: 100%;
`;

const cities = ["São Paulo", "Rio de Janeiro", "Brasília", "Salvador", "Manaus", "Recife", 
"Curitiba", "Fortaleza", "Porto Alegre", "Natal", "Florianópolis", "Belém", "Goiânia", "Maceió", 
"Campo Grande", "Cuiabá", "João Pessoa", "Aracaju", "Teresina", "Vitória", "São Luís", "Palmas", 
"Boa Vista", "Porto Velho"];
function FormViagem({ addViagem }) {
    const [origem, setOrigem] = useState('');
    const [destino, setDestino] = useState('');
    const [duracao, setDuracao] = useState(1);
    const [deadline, setDeadline] = useState('');

    const handleAddViagem = (event) => {
        event.preventDefault();
        addViagem(origem, destino, duracao, deadline);
        setOrigem('');
        setDestino('');
        setDuracao(1);
        setDeadline('');
    }

    const handleCancel = () => {
        setOrigem('');
        setDestino('');
        setDuracao(1);
        setDeadline('');
    }



    return (
        <FormContainer>
            <StyledForm onSubmit={handleAddViagem}>

<InputWrapper>
  <label>
      Origem:
      <StyledSelect value={origem} onChange={e => setOrigem(e.target.value)}>
          <option value="">Selecione uma cidade</option>
          {cities.map((city, index) => (
              <option key={index} value={city}>{city}</option>
          ))}
      </StyledSelect>
  </label>
</InputWrapper>
<InputWrapper>
  <label>
      Destino:
      <StyledSelect value={destino} onChange={e => setDestino(e.target.value)}>
          <option value="">Selecione uma cidade</option>
          {cities.map((city, index) => (
              <option key={index} value={city}>{city}</option>
          ))}
      </StyledSelect>
  </label>
</InputWrapper>
<InputWrapper>
  <label>
      Duração (dias):
      <StyledInput type="number" min="1" value={duracao} onChange={e => setDuracao(e.target.value)} />
  </label>
</InputWrapper>
<InputWrapper>
  <label>
      Deadline:
      <StyledInput type="date" value={deadline} onChange={e => setDeadline(e.target.value)} />
  </label>
</InputWrapper>
                <ButtonContainer>
                <StyledButton type="submit" value="Adicionar" />  
                <StyledButton type="button" onClick={handleCancel} value="Cancelar" />
                </ButtonContainer>

            </StyledForm>
        </FormContainer>
    );
}

export default FormViagem;
